import * as React from 'react';
import './index.scss';
import {Button, TextField, Form, FormLayout} from '@shopify/polaris';
import {useCallback, useState} from "react";
import ReCAPTCHA from "react-google-recaptcha";

const Register: React.FC<any> = () => {
    const formRegisterLeft = () => {
        return (
            <div>
                <div className={'form-title'}>Sign up</div>
                <div className={'wrapper-input'}>
                    <div>
                        <i className="fas fa-user"/>
                    </div>
                    <input type="text" placeholder={'Your Name'}/>
                    <small>Your name must has 6-50 characters</small>
                    <input type="text" placeholder={'Your Email'}/>
                    <small>illegal</small>
                    <input type="text" placeholder={'Your Address'}/>
                    <small>Your name must has 6-50 characters</small>
                    <input type="text" placeholder={'Phone Number'}/>
                    <small>Your name must has 6-50 characters</small>
                    <input type="text" placeholder={'Password'}/>
                    <small>Your name must has 6-50 characters</small>
                    <input type="text" placeholder={'Repeat your password'}/>
                    <small>Your name must has 6-50 characters</small>
                    <div style={{marginTop: 15}}>
                        <ReCAPTCHA sitekey="6Ldb6foUAAAAANXRBMbMqlZowbdhvcg1NBJGx7OG" onChange={() => {
                        }}/>
                    </div>
                    <button disabled>Register</button>
                </div>
            </div>
        )
    }

    const formRegisterRight = () => {
        return (
            <div>
                <div className={'wrapper-img'}>
                    <img src='https://colorlib.com/etc/regform/colorlib-regform-7/images/signup-image.jpg' alt='img'/>
                </div>
                <div className={'login-now'}>Login now</div>
            </div>
        )
    }
    return (
        <div className={'register'}>
            <div className={'wrapper-form'}>
                {formRegisterLeft()}
                {formRegisterRight()}
            </div>
        </div>
    )
}

export default Register;
